import React from 'react';


function Welcome({name, age}) {
  return (
    <div>
      <h3>I like {name}</h3>
      <span>{age}</span>
    </div>
  );
}

const peopleILike = [
  {
    id: 1,
    name: "Kim",
    age: 6
  },
  {
    id: 2,
    name: "Lim",
    age: 7
  },
  {
    id: 3,
    name: "Lee",
    age: 9
  }
];

function renderPeople(obj) {
  return <Welcome name={obj.name} age={obj.age}></Welcome>
}

function App() {
  return (
    <div className="App">
      {peopleILike.map((el) => renderPeople(el))}
    </div>
  );
}


export default App;
